import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { Form, Button } from "react-bootstrap";
import Message from "../components/Message";
import { login, googleLogin } from "../actions/userActions";
import { useGoogleLogin } from "@react-oauth/google";
import "./login-register.css";

export default function LoginPage({ history }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const dispatch = useDispatch();
  const { error, userInfo } = useSelector((s) => s.userLoginReducer || {});

  useEffect(() => {
    if (userInfo) history.push("/");
  }, [userInfo, history]);

  const submitHandler = (e) => {
    e.preventDefault();
    dispatch(login(username, password));
  };

  // Use Google popup but keep our custom button styling
  const startGoogle = useGoogleLogin({
    flow: "implicit", // popup
    scope: "openid email profile",
    onSuccess: async (resp) => {
      // If your backend expects an id_token, switch to 'authCode' or use the token to fetch userinfo.
      // Here we send the access_token to backend which fetches profile and logs in.
      if (resp?.access_token) {
        dispatch(googleLogin(resp.access_token)); // you already added this action
      }
    },
    onError: () => {
      console.warn("Google Sign-In failed");
    },
  });

  return (
    <div className="auth-page">
      <div className="auth-card">
        {/* LEFT: brand/visual (same feel as register) */}
        <div className="auth-side">
          <div className="auth-brand">
            <img src="/brand/logop.png" alt="Beauty Shop" />
          </div>
          <h2 className="auth-headline">Ravivez votre √©clat ‚ú®</h2>
          <p className="auth-blurb">
            Des routines simples, efficaces et adapt√©es √† votre peau.
            Connectez-vous pour poursuivre vos coups de c≈ìur.
          </p>
          <ul className="auth-bullets">
            <li>Suivi de commandes</li>
            <li>Wishlist synchronis√©e</li>
            <li>Offres personnalis√©es</li>
          </ul>
        </div>

        {/* RIGHT: form */}
        <div className="auth-form">
          <h1 className="auth-title">Connexion</h1>
          <p className="auth-sub">Ravi de vous revoir üëã</p>

          {error && <Message variant="danger">{error}</Message>}

          <Form onSubmit={submitHandler} className="auth-form-inner">
            <Form.Group controlId="username" className="mb-3">
              <Form.Label>Nom d‚Äôutilisateur</Form.Label>
              <Form.Control
                type="text"
                placeholder="Entrez votre nom d‚Äôutilisateur"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </Form.Group>

            <Form.Group controlId="password" className="mb-4">
              <Form.Label>Mot de passe</Form.Label>
              <Form.Control
                type="password"
                placeholder="Entrez votre mot de passe"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </Form.Group>

            <Button type="submit" variant="dark" className="auth-btn-primary">
              Se connecter
            </Button>

            <div className="auth-divider">
              <span>ou</span>
            </div>


          </Form>

          <div className="auth-switch">
            Pas de compte ? <Link to="/register">Cr√©er un compte</Link>
          </div>
        </div>
      </div>
    </div>
  );
}
